import React from "react";
import { useNavigate } from "react-router-dom";

const AddContactWithRouter = (props) => {
  const navigate = useNavigate();
  return <AddContact {...props} navigate={navigate} />;
};

class AddContact extends React.Component {
  state = {
    name: "",
    email: "",
    age: "",
    sex: "",
    city: "",
  };
  add = (e) => {
    e.preventDefault();
    if (
      this.state.name === "" ||
      this.state.email === "" ||
      this.state.age === "" ||
      this.state.sex === "" ||
      this.state.city === ""
    ) {
      alert("All the fields are mandatory!");
      return;
    }
    this.props.addContactHandler(this.state);
    this.setState({ name: "", email: "", age: "", sex: "", city: "" });
    this.props.navigate("/");
  };
  render() {
    return (
      <div
        className="ui main"
        style={{
          paddingTop: "50px",
        }}
      >
        <h2>Add Contact</h2>
        <form className="ui form" onSubmit={this.add}>
          <div className="field">
            <label style={{ fontSize: "1.2em" }}>Name</label>
            <input
              type="text"
              name="name"
              placeholder="Name"
              value={this.state.name}
              onChange={(e) => this.setState({ name: e.target.value })}
            />
          </div>
          <div className="field">
            <label style={{ fontSize: "1.2em" }}>Email</label>
            <input
              type="text"
              name="email"
              placeholder="Email"
              value={this.state.email}
              onChange={(e) => this.setState({ email: e.target.value })}
            ></input>
          </div>
          <div className="field">
            <label style={{ fontSize: "1.2em" }}>Age</label>
            <input
              type="number"
              name="age"
              placeholder="Age"
              value={this.state.age}
              onChange={(e) => this.setState({ age: e.target.value })}
            ></input>
          </div>
          <div className="field">
            <label style={{ fontSize: "1.2em" }}>Sex</label>
            <div>
              <input
                type="radio"
                id="male"
                name="sex"
                value="Male"
                checked={this.state.sex === "Male"}
                onChange={(e) => this.setState({ sex: e.target.value })}
              />
              <label htmlFor="male">Male</label>
            </div>
            <div>
              <input
                type="radio"
                id="female"
                name="sex"
                value="Female"
                checked={this.state.sex === "Female"}
                onChange={(e) => this.setState({ sex: e.target.value })}
              />
              <label htmlFor="female">Female</label>
            </div>
          </div>
          <div className="field">
            <label style={{ fontSize: "1.2em" }}>City</label>
            <input
              type="text"
              name="city"
              placeholder="City"
              value={this.state.city}
              onChange={(e) => this.setState({ city: e.target.value })}
            ></input>
          </div>
          <button className="ui button blue">Add</button>
        </form>
      </div>
    );
  }
}

export default AddContactWithRouter;
